// src/components/Header.js

import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.png';

function Header({ linkTo, linkText }) {
  return (
    <div className="flex justify-between items-center px-4 py-2 shadow-md bg-white">
      <div className="flex items-center">
        <img src={logo} alt="App Logo" className="h-10" /> {/* Adjust `h-10` for logo size */}
      </div>
      <div>
        <Link to={linkTo} className="text-customPurple font-medium hover:underline">
          {linkText}
        </Link>
      </div>
    </div>
  );
}

export default Header;
